import React from 'react';
import Heading from './Heading';
import Para from './Para';

function App()
{
    return(
        <>
        <ul>
            <li>The Addition of two number is{add(40,4)}</li>
            <li>The Substraction of two number is{sub(40,4)}</li>
            <li>The Multiplication of two number is{mult(40,4)}</li>
            <li>The Division of two number is{div(40,4)}</li>
        </ul>
       </>
    );
}

export default App;
